import React from "react";
import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <div style={{width: 3750, height: 2424, position: 'relative', background: '#FFF6EC', overflow: 'hidden'}}>
    <img style={{width: 1995, height: 1995, left: 1792, top: 214, position: 'absolute'}} src="https://placehold.co/1995x1995" />
    <div style={{width: 375, height: 119, paddingLeft: 72, paddingRight: 72, left: 3375, top: 0, position: 'absolute', background: '#FFF6EC', justifyContent: 'center', alignItems: 'center', gap: 10, display: 'inline-flex'}}>
      <div style={{textAlign: 'right', justifyContent: 'center', display: 'flex', flexDirection: 'column', color: '#FF5501', fontSize: 70, fontFamily: 'Noto Sans JP', fontWeight: '700', wordWrap: 'break-word'}}>Log in</div>
    </div>
    <div style={{width: 1986.48, height: 1010, left: 69, top: 632, position: 'absolute', textAlign: 'center', justifyContent: 'center', display: 'flex', flexDirection: 'column', color: '#FF5501', fontSize: 350, fontFamily: 'Titan One', fontWeight: '400', wordWrap: 'break-word'}}>MUNCH MATCH</div>
    <div style={{width: 989, height: 145, paddingLeft: 315, paddingRight: 315, paddingTop: 16, paddingBottom: 16, left: 568, top: 1642, position: 'absolute', background: 'radial-gradient(ellipse 50.00% 50.00% at 50.00% 50.00%, #FF7F36 19%, #FF5501 100%)', borderRadius: 60, justifyContent: 'center', alignItems: 'center', gap: 10, display: 'inline-flex'}}>
      <div style={{textAlign: 'center', justifyContent: 'center', display: 'flex', flexDirection: 'column', color: 'white', fontSize: 100, fontFamily: 'Noto Sans JP', fontWeight: '900', wordWrap: 'break-word'}}>Create Account</div>
    </div>
  </div>
  );
};

export default LandingPage;
